import React, { useState } from 'react';

const Home = ({ addressBook }) =>  {

    console.log(addressBook.view_all())

    const [, forceRender] = useState(undefined);
    return (
        <div>
            <table className="table">
                <thead className="thead-dark">
                    <tr>
                        <th>First Name</th>
                        <th>Last Name</th>
                        <th>Phone</th>
                        <th>Email</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    { addressBook.view_all().map((contact, index) => (
                        <tr key = {index}>
                            <td>{contact.first_name}</td>
                            <td>{contact.last_name}</td>
                            <td>{contact.phone}</td>
                            <td>{contact.email}</td>
                            <td>
                                {" "}
                                <button onClick={() => addressBook.delete_contact(index)}>{"delete"}</button>
                            </td>

                        </tr>    
                    )) }
                </tbody>
            </table>
        </div>
    );
};

export default Home;
